import React from "react";
import TodoCard from "./TodoCard";

import { ListGroup } from "react-bootstrap";

const TodoList = (props) => {
  console.log(props.todos);
  return (
    <ListGroup>
      {props.todos.map(({ id, content, due, checked }) => {
        if (props.showCompleted || !checked) {
          return (
            <TodoCard
              key={id}
              content={content}
              due={due}
              checked={checked}
              toggleMarkCompleted={props.toggleMarkCompleted}
              removeTodo={props.removeTodo}
            />
          );
        }
      })}
    </ListGroup>
  );
};

export default TodoList;
